    false,nt"url": null,nt"notes": "This data set contains lidar point data
    from a strip of Southern California coastline (including water, beach, cliffs, and
    top of cliffs) from Dana Point to Point La Jolla. The data set was created by combining
    data collected using an Optech Inc. Airborne Laser Terrain Mapper (ALTM) 1225 in
    combination with geodetic quality Global Positioning System (GPS) airborne and ground-based
    receivers. The Bureau of Economic Geology, the University of Texas at Austin owns
    and operates an ALTM 1225 system (serial number 99d118). The system is installed
    in a single engine Cessna 206 (tail number N4589U) owned and operated by the Texas
    State Aircraft Pooling Board. The lidar data set described by this document was
    collected at low tide on 22 May 2002 (14202) between 18:20 and 21:39 UTC (actual
    data collection). Conditions on that day were light clouds along the shoreline as
    well as offshore. 99d118 instrument settings for this flight were; laser pulse rate:
    25kHz, scanner rate: 26Hz (28Hz for calibration target), scan angle: +/-20deg, beam
    divergence: narrow, altitude: 680-780m AGL for first half of flight and 900-950
    for second half of flight, and ground speed: 83-125kts. Two GPS base stations (Scripps
    pier and San Onofre Power Plant) were operating during the survey. The survey included
    3 shoreline passes between Dana Point and Point La Jolla as well as one offshore
    pass along the 20m isobath. Data represented is all points including terrain, vegetation,
    and structures. This data also contains returns from the water surface. No processing
    has been done to remove returns from terrain, vegetation, structures or water surfaces.",nt"owner_org":
